INSERT INTO `error_no_description` VALUES (1,'Job sent','Reading job was sent correctly\r'),(100,'Communication server not available','While sending a job to the communication program it was detected, the SCS control center was either not started or crashed.\r'),(101,'Baud rate of communication device too low','The job could not be sent to the transmission channel, as the baud rate of the connected transmission device is too low.\r'),(102,'Bit number of communication device is too low','The job could not be sent to the transmission channel, as the maximum bit number (data bits, parity bits, stop bits) of the connected transmission device is too low.\r'),(103,'Configuration profile of communication device not defined','The job could not be sent to the corresponding transmission channel. The configuration profile entered in the device dialog was not defined for the connected communication equipment.\r'),(104,'Prefix not defined','The job could not be sent to the corresponding transmission channel. The prefix maintained in the device dialog was not defined.\r'),(105,'Set transfer channel not active','The job could not be sent to the transmission channel, because it is inactive.\r'),(106,'Recall number not defined','The job could not be sent to the corresponding transmission channel. For this device password/recall numbers were defined, but not for the transfer channels of the communication servers.\r'),(107,'No half-duplex operation possible','The job could not be sent to the transmission channel, because the connected transmission device does not support half-duplex operation.\r'),(108,'Wrong communication mode','The job could not be sent to the corresponding transmission channel. The communication mode defined in the device dialog (leased line or AT-modem) does not match.\r'),(109,'No matching communication server found','The job could not be sent to any communication server. There is no channel of a communication server matching this job.\r'),(110,'No matching channel found','The job could not be sent to the communication server, because no channel is suitable for this job.\r'),(112,'Tariff structure not assigned','This error occurs if the action \"Transfer tariff switching table\" is executed and no tariff structure is assigned to the billing data channel.\r'),(200,'Maximum delay for reading job exceeded','The max. delay time for reading result was exceeded. This job is marked as error. Results being received later are not processed. (Max. delay time = max. shift time adjustable in the schedule entry)\r'),(201,'Unknown error','General, not closer definable error\r'),(202,'Error opening the channel','Unable to open a serial port (COM port) of the PC.\r'),(203,'Remote device busy','Phone number of the remote reading device is busy\r'),(204,'Incorrect protocol at action \"xxx\"','Different errors occurred during the transfer (e.g. timeout error, max. block repetition exceeded, check sum error).\r'),(205,'No response of device','Modem connection was established. The remote device does not reply to the sent requests\r'),(206,'No device call','At recall procedure: expected recall missing\r'),(207,'No response by remote device','No response of modem by dialing the phone number.\r'),(208,'Communication equipment not ready','A modem of the communication program is switched off or does not respond.\r'),(209,'Initialization of the communication device failed','There is no response of a modem to the initialization command.\r'),(211,'Incorrect import','While importing the data into the database an error in the data structure was detected.\r'),(212,'Communication server not available','While receiving the reading results of the communication program (SCS) it was detected, that it was cancelled or crashed.\r'),(213,'Dial-up of communication device failed','It was impossible to connect to the transmission device (usually because of the automatic dial lock of the modem).\r'),(214,'Data read partially','If there are communication errors at the