f the communications services is suitable for this job.\r'),(227,'Job canceled by communication service','A job was canceled by an user.\r'),(229,'Device not logged in','While sending a job via the communication mode \"IP-T\" (internally), it was detected that the device is not logged in to any IP-T master.\r'),(230,'No tariff parameter files available','While sending a job with the action \"tariff download\" it was detected that no tariff parameter files are available.\r'),(231,'All actions inactive','While sending a job, it was detected that all actions of the action group are inactive.\r'),(232,'Tariff download failed','Execution an action \"Transfer tariff switching table\" was faulty\r'),(234,'Firmware download failed','Transfer of a firmware was faulty\r'),(235,'Job not existing in communication system','The job could not be found in the communication system.\r'),(236,'Action not executed successfully in Enerscape system','The selected action could not be executed successfully in the Enerscape system.\r'),(237,'Right not existing','The right for the action to be executed does not exist\r'),(300,'Processing OK','Successful reading, all data were imported into the database\r'),(301,'No data existing','Communication was successful, but no data are available for the set time frame\r'),(302,'Tariff download OK','Execution of an action \"Transfer tariff switching table\" was successful\r'),(303,'Firmware download OK','Transfer of a firmware was successful\r'),(500,'Switch to alternative communication mode: \"%1string\"','Due to a communication error an alternative communication mode was used for the reading.'),(541,'Total devices','Total devices\r'),(542,'Devices OK','Devices OK\r'),(543,'Devices incorrect','Devices incorrect'),(544,'Devices in process','Devices in process\r'),(545,'Devices not processed','Devices not processed\r'),(546,'Total readings','Total readings\r'),(547,'Readings OK','Readings OK\r'),(548,'Incorrect readings','Incorrect readings\r'),(549,'Re